CREATE TABLE IF NOT EXISTS pattern_thirty_twentynine (
    pattern_thirty_twentynine_id INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
    bucket_30 INT NOT NULL,
    bucket_30_59 INT NOT NULL
);

CREATE TABLE IF NOT EXISTS pattern_five_tens_nine (
    pattern_five_tens_nine_id INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
    pattern_thirty_twentynine_id INT NOT NULL,
    column_1 INT NOT NULL,
    column_2 INT NOT NULL,
    column_3 INT NOT NULL,
    column_4 INT NOT NULL,
    column_5 INT NOT NULL,
    column_6 INT NOT NULL,
    total_combination INT NOT NULL,
    FOREIGN KEY (pattern_thirty_twentynine_id) REFERENCES pattern_thirty_twentynine(pattern_thirty_twentynine_id)
);

CREATE TABLE IF NOT EXISTS pattern_odd_even (
    pattern_odd_even_id INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
    type_1 INT NOT NULL,
    type_2 INT NOT NULL,
    type_3 INT NOT NULL,
    type_4 INT NOT NULL,
    type_5 INT NOT NULL,
    type_6 INT NOT NULL
);






